import React, { Component } from 'react';
import '../App.css';
import location from '../location1.png'
import linkedin from '../linkedin1.png'
import git from '../git1.png'

class Contact extends Component {
  render() {
    return (

      <div >


<div class="container-fluid" id="maincontainer">

<div class ="row" id="rowheading">
<div class="col">
<p class="text-left" id="helloheading2">Contact Me</p>
<p class="text-left" id="firstpara">I'm a colorado based web developer, having a Bachelor's Degree in Computer Science4 </p>
</div>
</div>
<div class ="row" id="rowheading">
<div class="col-lg-6 col-md-6 col-sm-12 col-xs-12">
<p class="text-left" id="heading">Skills & Experience</p>
</div>
</div>

<div class ="row" id="rowsingleline">
<div class="col-lg-6 col-md-6 col-sm-12 col-xs-12">
<p class="text-left" id="singlepara">Main area of my expertise is fornt-end web development (client side). HTML, CSS JS(ES2015), building small and medium web applications with React.js, custom plugins, featurs, animations and coding interactive layouts  I have also Full stack experience with Microsoft technologies such as MVC, Entity Frame-work, C#, SQL and VB.net along with some open-source CMS like wordpress, Drupal, Magneto, Keystone.js and others      </p>
</div>
</div>
<div class="container" id="footer">  </div>
</div>
      </div>
    );
  }
}

export default Contact;
